import React, { Component } from 'react';

class Counter extends Component {
    state = {
        count: 0,
        imageUrl1: 'https://picsum.photos/200',
        imageUrl2: 'https://picsum.photos/199',
        imageUrl3: 'https://picsum.photos/201',
        imageUrl4: 'https://picsum.photos/198'
    } ;
    render() { 
        return (
            <React.Fragment>
                <div>
                    <img src={this.state.imageUrl1} alt="" />
                    <img src={this.state.imageUrl2} alt="" />
                    <img src={this.state.imageUrl3} alt="" />
                    <img src={this.state.imageUrl4} alt="" />
                </div>
                <span>{this.formatCount()}</span>
                <button>Increament</button>
            </React.Fragment>
        );
    }
    formatCount() {
        const { count } = this.state;
        return count === 0 ? 'Zero' : count;
    }
}
 
export default Counter;
